export const action1 = (dispatch, test1, test2) => {
    let NewArray = 0
    if (test1) {
        NewArray += 1
    } else if (test2) {
        NewArray -= 1
    }
    dispatch({ type: 'action1', payload: console.log(NewArray) })
}

export const appearCat = (dispatch, Cat) => {
    const NewArray = []
    for (let i in Cat) {
        for (let f in Cat[i]) {
            for (let g in Cat[i][f]) {
                NewArray.push(Cat[i][f][g])
                dispatch({ type: 'appearCat', payload: NewArray })
            }
        }
    }
}
